macro_rules! impl_select_instrument {
	[$base:ident => $(($doc:expr, $func_name: ident, $struct_name: ident, $code:expr)),+ $(,)?] => {
        $(
		        // #[must_use]
            #[derive(Debug, Clone)]
            pub struct $struct_name {
                instrument_type: String,
            }

            impl $struct_name {
                pub(crate) fn new() -> Self {
                    Self {
                        instrument_type: $code.to_string(),
                    }
                }
            }

            impl $base {
            		#[doc=concat!("Function for selecting ", stringify!($doc), " instruments.")]
                pub fn $func_name() -> $struct_name {
                    $struct_name::new()
                }
            }
        )+
    };
}

