macro_rules! impl_select_location {
	[$base:ident => $(($doc:expr, $func_name: ident, $struct_name_new: ident, $code:expr)),+ $(,)?] => {
        $(
            // #[inline]
            #[must_use]
            #[doc=concat!("Create ScannerSubsctibtion for ", stringify!($doc), " instruments.")]
            pub struct $struct_name_new {
                instrument_type: String,
                location_code: String
            }

            impl $base {
                pub fn $func_name(self) -> $struct_name_new {
                    $struct_name_new {
                        instrument_type: self.instrument_type,
                        location_code: $code.to_string()
                    }
                }
            }

        )+
    };
}

