#[derive(Debug, Clone, PartialEq, Eq, Hash)]
pub struct ScannerSubscriptionWithFilters {
    instrument_type: String,
    location_code: String,
    scan_code: String,
    number_of_rows: i32,
    filters: Vec<(String, String)>
}



macro_rules! impl_select_scan_code {
 [ $doc1:expr, $doc2:expr, $func_name:ident, $code:expr => ($($struct_name_new:ident),*) ] => {
        $(
            impl $struct_name_new {
                #[doc=concat!("Select scan code: ", stringify!(concat!($doc1, '.', $doc2)))]
                pub fn $func_name(self) -> ScannerSubscriptionWithFilters {
                    ScannerSubscriptionWithFilters{
                        instrument_type: self.instrument_type,
                        location_code: self.location_code,
                        scan_code: $code.to_string(),
                        number_of_rows: NO_ROW_NUMBER_SPECIFIED,
                        filters: Vec::new(),
                    }
                }
            }

	            // #[doc=concat!("Select scan code: ", stringify!(concat!($doc1, '.' doc2)))]
        )+
    };
}





