macro_rules! impl_select_filters {
    [ $( ($func_name:ident, $code:expr, $parameter_type: ty, $doc:expr) ),* $(,)? ] => {
        $(
            impl ScannerSubscriptionWithFilters {
                #[inline]
                #[must_use]
                #[doc=stringify!($doc)]
                pub fn $func_name(mut self, parameter: $parameter_type) -> Self {
                    self.filters.push(($code.to_string(), serde_json::to_string(&parameter).unwrap()));

                    Self {
                        instrument_type: self.instrument_type,
                        location_code: self.location_code,
                        scan_code: self.scan_code,
                        number_of_rows: self.number_of_rows,
                        filters: self.filters,
                    }
                }
            }
        )*

   };
}


